#!/usr/bin/env python3

# Sequences are considered characters, tuple and list.

# Define DNA sequence as dna
dna = ''

# Print the length of the DNA sequence
print("DNA size is",len(dna))

# Print the number of A in DNA sequence
print("Number of A",dna.count('A'))

# Print the number of T in DNA sequence
print("Number of T",dna.count('T'))

# Print the number of G in DNA sequence
print("Number of G",dna.count('G'))

# Print the number of C in DNA sequence
print("Number of C",dna.count('C'))


# Defining bird as chicken
bird = 'chicken'

# Print bird variable as uppercase
print(bird,"in uppercase:",bird.upper())















